import "../userHome.css";

export default function UserHome() {
	return (
		<div className="user-home-container">
			<h1 className="recipe-header">Rcepies</h1>
			<ul>
				<li>1</li>
				<li>2</li>
				<li>3</li>
				<li>4</li>
				<li>5</li>
			</ul>
		</div>
	);
}
